							<div id="tab-panel-overview" class="help-tab-content active">
								<p>This screen is used for managing your navigation menus.</p><p>Menus can be displayed in locations defined by your theme, even used in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="https://safe-sanjeev-5oqe.zipwp.link/wp-admin/widgets.php">Widgets</a> screen. If your theme does not support the navigation menus feature (the default themes, Twenty Twenty and Twenty Twenty-One, do), you can learn about adding this support by following the documentation link to the side.</p><p>From this screen you can:</p><ul><li>Create, edit, and delete menus</li><li>Add, organize, and modify individual menu items</li></ul>							</div>
							
							<div id="tab-panel-menu-management" class="help-tab-content">
								<p>The menu management box at the top of the screen is used to control which menu is opened in the editor below.</p><ul><li>To edit an existing menu, <strong>choose a menu from the dropdown and click Select</strong></li><li>If you have not yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started</li></ul><p>You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.</p>							</div>
							
							<div id="tab-panel-editing-menus" class="help-tab-content">
								<p>Each navigation menu may contain a mix of links to pages, categories, custom URLs or other content types. Menu links are added by selecting items from the expanding boxes in the left-hand column below.</p><p><strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.</p><ul><li>Add one or several items at once by <strong>selecting the checkbox next to each item and clicking Add to Menu</strong></li><li>To add a custom link, <strong>expand the Custom Links section, enter a URL and link text, and click Add to Menu</strong></li><li>To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu</li><li>Delete a menu item by <strong>expanding it and clicking the Remove link</strong></li></ul>							</div>
